        placeholder='phone'
        name="phone"
        onChange={handleChange}
        required
        />
        <input
         type="password"
         placeholder='password'
         name="password"
         onChange={handleChange}
        required
        /><br/>
        <button className="btn btn-success" type="submit">
         Submit   
        </button> 
        </form>
        
    </div>
  )
}
